{"query":"
  query GET_TOTAL_LISTING_COUNT_BY_QUERY_STRING(
    $queryString: String!
    $locale: Locale_
  ) {
    search {
      listingsByQueryString(queryString: $queryString, locale: $locale) {
        metadata {
          totalItems
        }
      }
    }
  }
","variables":{"queryString":"sort=standard&desc=0&ustate=N,U&atype=C&ocs_listing=include&lm_premium=true&specialconditions=true","locale":"de_DE"}}
